import React from "react";

function Home() {
  const Getemail = localStorage.getItem("sanskarEmail");
  console.log(Getemail);
  return (
    <div style={{ paddingTop: "120px" }}>
      <h1>
        Email:
        {Getemail}
      </h1>
    </div>
  );
}

export default Home;
